import React, {useState} from 'react'

import {
    Button,
    Table,
    TableContainer,
    TableFooter,
    TableHead,
    TableBody,
    TableRow,
    TableCell,
    Container,
    MenuItem,
    Menu,
    TablePagination

    
    
} from '@mui/material'
import MoreVertIcon from '@mui/icons-material/MoreVert'


const Import = (props) => {
    // fill out this component
    console.log(props)
// *pagination

const [makes] = React.useState([]);

// Avoid a layout jump when reaching the last page with empty rows.
const emptyRows =
page > 0 ? Math.max(0, (1 + page) * rowsPerPage - makes.length) : 0;

const handleFirstPageButtonClick = (event) => {
    onPageChange(event, 0);
  };

  const handleBackButtonClick = (event) => {
    onPageChange(event, page - 1);
  };

  const handleNextButtonClick = (event) => {
    onPageChange(event, page + 1);
  };

  const handleLastPageButtonClick = (event) => {
    onPageChange(event, Math.max(0, Math.ceil(count / rowsPerPage) - 1));
  };








    const [anchorEl, setAnchorEl] = React.useState(null);

    const handleClick = (event) => {
        setAnchorEl(event.currentTarget);
    }
    const handleClose = () => {
        setAnchorEl(null);
      };
    const [deleteMakes] = useState(null);

    const handleDeletes = (index) => {
        props.deleteMakes(deleteMakes, index)
        setAnchorEl(null);
    }

    return (
      
        <Container>
              <br />
              <br />
        <Button
            variant="contained"
            color="primary"
            onClick={props.fetchMakes}>Import</Button>
            
            <h2> Count: {props.makes.length}</h2>

            <TableContainer>
            <Table>
            <TableHead>
                <TableRow>
                    <TableCell>Id</TableCell>
                    <TableCell>Make</TableCell>
                    <TableCell>Actions</TableCell>
                </TableRow>
            </TableHead>
            <TableBody>
            {(rowsPerPage > 0
              ? props.makes.slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
              : props.makes
            ).map((makes, index) => (
          
                    <TableRow key={index}>
                        <TableCell>{makes.MakeId}</TableCell>
                        <TableCell>{makes.MakeName}</TableCell>
                        <TableCell>
                            <MoreVertIcon onClick={handleClick} />
                         
                            <Menu   
                                    id="basic-menu"
                                    anchorEl={anchorEl}
                                    keepMounted
                                    open={Boolean(anchorEl)}
                                    onClose={handleClose}
                                 
                                    
                                >
                                    <MenuItem onClick={handleDeletes}>Delete</MenuItem>
                                    <MenuItem onClick={handleClose}>Close</MenuItem>
                                </Menu>
                                                        
                         </TableCell>   
                    </TableRow>
                    
                    
            ))}

        {emptyRows > 0 && (
              <TableRow style={{ height: 53 * emptyRows }}>
                <TableCell colSpan={6} />
              </TableRow>
            )}
            </TableBody>
        </Table>
        </TableContainer>
        <br />
     {/* pagination */}
  
  










      
</Container>
        
    )
}

export default Import
